[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT DISTINCT ?protein ?proteinName ?function ?gene
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:annotation ?annotation ;
           up:recommendedName ?recName .

  ?recName up:fullName ?proteinName .

  ?annotation a up:Function_Annotation ;
              rdfs:comment ?function .

  OPTIONAL {
    ?protein up:encodedBy ?gene_node .
    ?gene_node skos:prefLabel ?gene .
  }

  FILTER(
    REGEX(?function, "tumor suppressor", "i") ||
    REGEX(?function, "tumour suppressor", "i") ||
    REGEX(?function, "suppressor of tumor", "i") ||
    REGEX(?function, "cancer suppressor", "i")
  )
}
LIMIT 100
"}}]

[{"name": "mcp__togomcp__search_chembl_target", "input": {"query": "EGFR human epidermal growth factor receptor", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX chembl: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?molname ?standard_value ?standard_units ?activity_type ?assay_desc
WHERE {
  ?activity a chembl:Activity ;
            chembl:hasMolecule ?molecule ;
            chembl:hasAssay ?assay .

  ?assay chembl:hasTarget <http://rdf.ebi.ac.uk/resource/chembl/target/CHEMBL203> .

  ?activity chembl:standardValue ?standard_value ;
            chembl:standardUnits ?standard_units ;
            chembl:type ?activity_type .

  ?molecule rdfs:label ?molname .

  OPTIONAL { ?assay chembl:assayDescription ?assay_desc }

  FILTER (?activity_type IN ("IC50", "Ki", "Kd"))
  FILTER (?standard_value < 10)
  FILTER (?standard_units = "nM")
}
ORDER BY ?standard_value
LIMIT 30"}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "osimertinib", "limit": 3}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "afatinib", "limit": 3}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "neratinib", "limit": 3}}, {"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "erlotinib", "limit": 3}}]

[{"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "CHEMBL941", "limit": 5}}, {"name": "mcp__togomcp__togoid_convertId", "input": {"ids": "CHEMBL941", "route": "chembl.compound,pubchem.compound", "limit": 10}}, {"name": "mcp__togomcp__togoid_getAllRelation", "input": {}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX chembl: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?pubchem_id
WHERE {
  ?molecule a chembl:SmallMolecule ;
            chembl:chemblId "CHEMBL941" ;
            cco:hasDatabaseCrossReference ?xref .
  ?xref cco:databaseSource "PubChem" ;
        cco:databaseReference ?pubchem_id .
}"}}, {"name": "mcp__togomcp__togoid_convertId", "input": {"ids": "CHEMBL941", "route": "chembl_compound,pubchem_compound", "limit": 10}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX chembl: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?molecule ?label ?inchikey
WHERE {
  ?molecule a chembl:SmallMolecule ;
            chembl:chemblId "CHEMBL941" .
  OPTIONAL { ?molecule skos:prefLabel ?label }
  OPTIONAL { ?molecule chembl:inchikey ?inchikey }
}
LIMIT 10"}}, {"name": "mcp__togomcp__get_compound_attributes_from_pubchem", "input": {"pubchem_compound_id": "5291"}}]

